import HomePage from './Components/HomePage/HomePage';
import WorkLog from './Components/WorkLog/WorkLog';
import './App.css'
import { Route, Routes } from 'react-router-dom';

function App (){
  return (
    <Routes>
      <Route path = "/" element = {<HomePage/>}/>
      <Route path = "/worklog" element = {<WorkLog/>}/>
    </Routes>
  )

}

export default App;
